import React from 'react'

function Search({ handleInput }) {
    return (
        <section className="searchbox-wrap">
            <input
                type="text"
                className="searchbox"
                placeholder="Search for a movie...."
                onChange={handleInput} />

        </section>
    )
}

export default Search
